    expressWinston.logger({
        transports: [
            new winston.transports.MongoDB({
                db: `${process.env.DATABASE_URI}`,
                options: { useUnifiedTopology: true },
                metaKey: "meta"
            }),
        ],
        format: winston.format.json({ space: 2 }),
        meta: true,
        msg: "HTTP {{req.method}} {{req.url}}",
        expressFormat: true,
        colorize: true
    });
    next();
};
module.exports = logger;

